import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import ReadingList from './readinglist';
import BestSellerSearch from './bestsellersearch';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='header-content'>
        <img src={logo} className="App-logo" alt="logo" /> Search them all!
        <button className='header-button'><Link style={{color: 'white'}} to="/">Home</Link></button>
        <button className='header-button'><Link style={{color: 'white'}} to="/pokemon">Pokemon</Link></button>
      </div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
